  return (
    <div
      className="ui container"
      style={{ marginTop: "10px", marginBottom: "10px" }}
    >
      <BrowserRouter>
        <div>
          <h2>Hi {name}, here's your financial snapshot!</h2>
          <NetAmount />
          <TransactionList />
        </div>
      </BrowserRouter>
    </div>
  );
};
